import React, { useState } from 'react';
import { Navigate } from 'react-router';
import styled from 'styled-components';
import { Link } from 'react-router-dom';
import { useLocation } from 'react-router-dom';

const Container = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  background-color: #488aee; /* Î∞∞Í≤ΩÏÉâ ÏÑ§Ï†ï */
  padding: 20px; /* Ï†ÅÏ†àÌïú Ìå®Îî© Ï∂îÍ∞Ä */
  min-height: 100vh;
  
`;

const LogoImage = styled.img`
  width: 400px; /* ÌÅ∞ Î°úÍ≥† ÌÅ¨Í∏∞ */
  height: auto;
  margin-top: 0px;
  margin-bottom: 0px;
`;

const InputContainer = styled.div`

  display: flex;
  flex-direction: column;
  align-items: center;
  margin-bottom: 20px;
  
`;

const Input = styled.input`

  width: 300px;
  height: 40px;
  margin-bottom: 30px;
  margin-top: 30px;
  padding: 10px;
  border-radius: 200px;
  border: none;
  box-shadow: 0px 0px 15px 0px rgba(0,0,0,0.4);
  
`;


const RoundedBox = styled.div`
  border-radius: 200px;
  width:700px;
  height:800px;
  padding: 70px;
  background-color: #91B9F5; /* Î∞∞Í≤ΩÏÉâ ÏÑ§Ï†ï */
  box-shadow: 0px 0px 15px 0px rgba(0,0,0,0.2); /* Í∑∏Î¶ºÏûê Ìö®Í≥º */
  margin-top: 50px;
  
`;
const SignUpButton = styled.button`
display: block;
width: 200px; /* Î≤ÑÌäºÏù¥ Ïª®ÌÖåÏù¥ÎÑàÏùò Í∞ÄÎ°ú Í∏∏Ïù¥Î•º Í∞ÄÏßÄÎèÑÎ°ù Ìï® */
background-color: #0066ff;
color: white;
border: none;
border-radius: 200px;
padding: 10px 20px;
font-size: 16px;
cursor: pointer;
box-shadow: 0px 0px 15px 0px rgba(0,0,0,0.2);
margin-top:20px;
`;

const BackButton = styled.button`
display: block;
width: 200px; /* Î≤ÑÌäºÏù¥ Ïª®ÌÖåÏù¥ÎÑàÏùò Í∞ÄÎ°ú Í∏∏Ïù¥Î•º Í∞ÄÏßÄÎèÑÎ°ù Ìï® */
background-color: #0066ff;
color: white;
border: none;
border-radius: 200px;
padding: 10px 20px;
font-size: 16px;
cursor: pointer;
box-shadow: 0px 0px 15px 0px rgba(0,0,0,0.2);
margin-top:20px;
`;



const logobuife = '/info.png';


const SignUp3 =()=> {
  const location = useLocation();
  const userID = location.state?.userID || '';
  const [code, setcode] = useState('');

  
  const handleSubmit = async () => {
    try {

      
      const params = new URLSearchParams();
      params.append('code', code);


      const requestOptions = {
        method: 'POST',
        headers: {
          'Content-Type': 'application/x-www-form-urlencoded',
 
        },
        credentials : 'include',
        body: params,
      };
   
  

      const response = await fetch('https://port-0-server-cloudtype-4fju66f2clmyxbee6.sel5.cloudtype.app/members/new/emailCheck', requestOptions);
      
      if (!response.ok) {
        throw new Error('ÏÑúÎ≤Ñ ÏùëÎãµÏù¥ Ïã§Ìå®ÌñàÏäµÎãàÎã§.');
      }

      const data = await response.text();
      //userIDÎ•º ÌôïÏù∏ÌïòÍ∏∞ ÏúÑÌïú alert
      //alert(requestOptions.data.userID + "Îãò, ÏÑ±Í≥µÏ†ÅÏúºÎ°ú Î°úÍ∑∏Ïù∏ ÎêòÏóàÏäµÎãàÎã§ üîê");
      window.location.href = '/loginform'; // URL Î≥ÄÍ≤Ω // Î°úÍ∑∏Ïù∏Ïù¥ ÏÑ±Í≥µÌñàÏùÑ ÎïåÏùò Î°úÏßÅ
       console.log(data); // ÏÑúÎ≤ÑÏóêÏÑú Î∞õÏùÄ Îç∞Ïù¥ÌÑ∞ ÌôïÏù∏
       //ÏÑúÎ≤ÑÏóêÏÑú Ï†ÑÎã¨Îêú ÌÜ†ÌÅ∞
       //ÌÜ†ÌÅ∞ÏùÑ Î°úÏª¨ Ïä§ÌÜ†Î¶¨ÏßÄÏóê Ï†ÄÏû•
      // localStorage.setItem('token',token);
       //localStorage.setItem("bbs_access_token", requestOptions.token);
			 //localStorage.setItem("id", requestOptions.data.userID);

       //Î°úÍ∑∏Ïù∏Ïù¥ ÏÑ±Í≥µÌïòÎ©¥ Îã§ÏùåÌéòÏù¥ÏßÄÎ°ú Ïù¥Îèô 
    } catch (error) {
      console.error('Î°úÍ∑∏Ïù∏ Ïã§Ìå®:', error);
 
      // Î°úÍ∑∏Ïù∏ Ïã§Ìå® ÏãúÏùò Ï≤òÎ¶¨ Î°úÏßÅÏùÑ Ï∂îÍ∞ÄÌïòÏÑ∏Ïöî
    }
  };
 
 return (
   <div className="App">
     <div className="mainpage">
       
       <div className="mainbox">
        <Container>
          <RoundedBox>
          <Link to="/.">
            <LogoImage src={logobuife} alt="Buife Î°úÍ≥†" />
          </Link>

        
            <InputContainer>

            <p>Ïù∏Ï¶ùÎ≤àÌò∏Í∞Ä {userID}ÏúºÎ°ú Ï†ÑÏÜ°ÎêòÏóàÏäµÎãàÎã§. Ïù∏Ï¶ùÎ≤àÌò∏ 8ÏûêÎ¶¨Î•º ÏïÑÎûòÏóê ÏûÖÎ†•Ìï¥Ï£ºÏÑ∏Ïöî.</p>
            <Input
             type="text" 
             placeholder="Ïù∏Ï¶ùÎ≤àÌò∏ ÏûÖÎ†•"
             onChange={(e) => setcode(e.target.value)}
            />

                    <SignUpButton 
                    type="button"
                    className="signupButton"
                    onClick={handleSubmit}
                    >ÌöåÏõêÍ∞ÄÏûÖ
                    </SignUpButton>
                    
                    <Link to="/signup2">
                    <BackButton type="button"
                    className="BackButton">Îí§Î°úÍ∞ÄÍ∏∞
                    </BackButton>
                    </Link>

            </InputContainer>
        
          </RoundedBox>
         </Container>
       </div>
     </div>
   </div>
 );
}



export default SignUp3;
